description:
Originally ripped from VHS by someone else in low rez for the web.

Edited together from pieces and re-encoded to 720x480 @ 1.64 Mbps (I know it does nothing for the image, but I was going to burn it to DVD).

This is the Camel Trophy video that covers the years from 1980 to 1989.  The first half of the video is short clips and narration of the Camel Trophy events held worldwide. The second half is the Camel Trophy 4x4 driving school.

Quality isn't great (in fact it's quite bad!) but it's better than nothing.  This video is very rare and as far as I know, no longer available.  If I ever get an actual copy (only released on VHS) I'll do my best to get it digitized in a much better quality.

